import React, {useState, useEffect} from 'react'
import {useHistory, Link, useParams} from "react-router-dom"
import SelfWorkspaceCard from '../Components/Self-Workspace-Row-Card'
import workspacesAPI from '../API/workspaces'

const AccountWorkspaces = () => {
    const [workspaces, setWorkspaces] = useState();
    const [loaded, setLoaded] = useState(false);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const workspaces = await workspacesAPI.get("/");

                setWorkspaces(workspaces.data.data);
                setLoaded(true);
            } catch (err) {}
        }
        fetchData();
    }, [])

    return (
        <>
            {loaded &&
                <div className="width-body">  
                    <div className="account-workspaces-body">
                        <div className="account-workspaces-top">
                            <h1>My Workspaces</h1>
                            <Link to="/new-workspace" className="blue-button">New Workspace</Link>
                        </div>
                        <div className="account-workspaces-list">
                            {workspaces.map((workspace, i) => {
                                return <SelfWorkspaceCard workspace={workspace} key={i} />
                            })}
                        </div>
                    </div>
                </div>
            }
        </>
    )
}

export default AccountWorkspaces
